/**
 * The Scalable Broker web application does not have any functionality for exporting transaction lists, so this is my attempt to get one :)
 *
 * exportTransactions
 *
 * Usage:
 * 1. Navigate to https://de.scalable.capital/broker/transactions
 * 2. Just copy and paste content of the scalable-broker.js into development console of your browser
 * 3. Save the CSV
 *
 * @type {{exportTransactions: scalableBroker.exportTransactions}}
 */
var scalableBroker = (function () {

    function playAudio() {
        var audio = new Audio("data:audio/wav;base64,");
        audio.play();
    }

    function getElement(node, xpath) {
        var iterator = document.evaluate(xpath, node, null, XPathResult.UNORDERED_NODE_ITERATOR_TYPE, null);
        try {
            var thisNode = iterator.iterateNext();
            if (thisNode) {
                return thisNode.textContent;
            }
        } catch (e) {
            console.log('Error: ' + e);
        }
    }

    function getPrices(priceMap) {
        var iterator = document.evaluate('//tr[contains(@class, \'MuiTableRow-root\')]', document, null, XPathResult.UNORDERED_NODE_ITERATOR_TYPE, null);
        try {
            var thisNode = iterator.iterateNext();
            var found = false;
            while (thisNode) {
                // console.log(thisNode.textContent);
                let shareName = getElement(thisNode, './/th/div/div/div/div/div');
                if (shareName) {
                    let priceDelta = getElement(thisNode, './/td');
                    let priceProc = getElement(thisNode, './/td[2]');
                    // console.log(shareName);
                    // console.log(priceDelta);
                    // console.log(price);
                    if (priceDelta && priceProc) {
                        found = true;
                        let currentPriceProc = parseFloat(priceProc.replace('%', '').replace('.', '').replace(',', '.'));
                        // console.log(currentPrice);
                        let lastPriceProc = priceMap.get(shareName)
                        if (lastPriceProc) {
                            if (currentPriceProc >= lastPriceProc) {
                                priceMap.set(shareName, currentPriceProc);
                            } else {
                                let diff = lastPriceProc - currentPriceProc;
                                if (diff > 1) {
                                    playAudio();
                                    console.log(shareName + ': ' + lastPriceProc + '-' + currentPriceProc + '=' + diff);
                                }
                            }
                        } else {
                            priceMap.set(shareName, currentPriceProc);
                        }
                    }
                }
                thisNode = iterator.iterateNext();
            }
            if (!found) {
                console.log('No prices found!')
            }
        } catch (e) {
            console.log('Error: ' + e);
        }
    }

    return {
        exportTransactions: function () {
            let priceMap = new Map()
            getPrices(priceMap);
            (function myLoop() {
                setTimeout(function () {
                    getPrices(priceMap);
                    myLoop();
                }, 10000)
            })();
        }
    };
})
();

scalableBroker.exportTransactions();